import React from 'react';
import ReactDOM from 'react-dom';
import './landing.css';
import * as serviceWorker from './serviceWorker';

const Landing = () => {
  function create_account_expand () {
    console.log("working");
    var elems = document.getElementsByClassName("confirmation");
    for (var i = 0; i < elems.length;  i++)  {
      elems[i].style.visibilty = "visibile";
      elems[i].style.height = "100px";
      console.log(i);
    }
  }
    return (
        <div class="login">
            <h1>Email Address</h1>
            <form onSubmit="">
              <label>
                <input type="text" value="" onChange="" />
              </label>
            </form>
            <div class="confirmation">
              <h1>Confirm Email Address</h1>
              <form onSubmit="">
                <label>
                  <input type="text" value="" onChange="" />
                </label>
              </form>
            </div>
            <h1>Password</h1>
            <form onSubmit="">
              <label>
                <input type="text" value="" onChange="" />
              </label>
            </form>
            <div class="confirmation">
              <h1>Confirm Password</h1>
              <form onSubmit="">
                <label>
                  <input type="text" value="" onChange="" />
                </label>
              </form>
            </div>
            <button>Login</button>
            <button onClick={this.create_account_expand()}>Sign up</button>
        </div>
    );
}

export default Landing;
